const LateralMenu: React.FC = () => {

  return (
    <Container>
      <Header>
        <LogoImg src={logo} alt="logo Spotify" />
        <Title> SpotIfood </Title>
      </Header>
    </Container>
  );
};

export default LateralMenu;
